import * as styles from '../../../styles/buttons.module.scss'

function Button(props: any) {
  const styleProps = {
    width: `${props.styles.width}`,
    height: `${props.styles.width}`,
  }
  return (
    <button styles={{ styleProps }} className={styles.button}>
      {props.children}
    </button>
  )
}
export default Button
